"""
Given an array of integers nums and an integer target, return indices of the two numbers such that they add up to target.

You may assume that each input would have exactly one solution, and you may not use the same element twice.

You can return the answer in any order.

Examples:

Input: nums = [2,7,11,15], target = 9
Output: [0,1]
Explanation: Because nums[0] + nums[1] == 9, we return [0, 1].


Input: nums = [3,2,4], target = 6
Output: [1,2]


Input: nums = [3,3], target = 6
Output: [0,1]
"""

from typing import List
from random import randrange
from time import time


class Solution:

    def two_sum(self, nums: List[int], target: int) -> List[int]:
        our_hash = {}
        for index, num in enumerate(nums):
            our_hash[num] = index
        for ind, number in enumerate(nums):
            potential_solution_number = target - number
            if potential_solution_number in our_hash and our_hash[potential_solution_number] != ind:
                return [our_hash[potential_solution_number], ind]

    def two_sum_on_steroids(self, nums: List[int], target: int) -> List[int]:
        our_hash = {}
        for index, num in enumerate(nums):
            our_hash[str(num)] = index
        for ind, number in enumerate(nums):
            potential_solution_number = target - number
            if str(potential_solution_number) in our_hash and our_hash[str(potential_solution_number)] != ind:
                return [our_hash[str(potential_solution_number)], ind]

    def two_sum_but_shorter(self, nums: List[int], target: int) -> List[int]:
        our_hash = {}
        for i in range(len(nums)):
            complement = target - nums[i]
            if complement in our_hash:
                return [i, our_hash[complement]]
            our_hash[nums[i]] = i

    def rand_gen(self):
        return [randrange(10000) for i in range(10000)]


